import React from 'react';
import Cards from './Cards';

const CardsList = ({ people }) => {

	const peo = (person) => {
		return(
			<div>
				{ person && <Cards person = { (people[0]) }/> }			
			</div>
		)
	}

	peo(people)
}

export default CardsList;
